import React from "react";
import TodoItemTitle from "./TodoItemTitle/CompletedTitleRenderer";

const TodoItemContainer = ({ id, title, isCompleted }) => {
   const doneButton = isCompleted ? <button disabled>done</button> : <button>to done</button>;
   return (
      <div>
         <TodoItemTitle title={title} />
         {doneButton}
         <button>change</button>
         <button>remove</button>
      </div>
   );
};

export default TodoItemContainer;
